import React from 'react';
import '../styles/Skills.css';

const Skills = () => {
  const skills = [
    { name: 'Java', level: 90, icon: '‚ô®Ô∏è' },
    { name: 'Python', level: 85, icon: 'üêç' },
    { name: 'JavaScript', level: 88, icon: '‚ö°' },
    { name: 'Node.js', level: 85, icon: 'üü¢' },
    { name: 'React.js', level: 80, icon: '‚öõÔ∏è' },
    { name: 'MySQL', level: 90, icon: 'üóÑÔ∏è' },
    { name: 'PostgreSQL', level: 85, icon: 'üêò' },
    { name: 'Git', level: 88, icon: 'üì¶' },
    { name: 'REST APIs', level: 92, icon: 'üîå' }
  ];

  return (
    <section id="skills" className="skills">
      <div className="skills-container">
        <h2 className="section-title">Technical Skills</h2>
        <p className="section-subtitle">
          The tools and technologies I use to bring ideas to life
        </p>

        <div className="skills-grid">
          {skills.map((skill, index) => (
            <div key={index} className="skill-card">
              <div className="skill-icon">{skill.icon}</div>
              <h3 className="skill-name">{skill.name}</h3>
              <div className="skill-bar">
                <div 
                  className="skill-progress" 
                  style={{ width: `${skill.level}%` }}
                >
                  <span className="skill-percentage">{skill.level}%</span>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
